import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faColumns, faChartBar, faUserCircle, faBoxes, faShoppingCart, faFileInvoice, faCog, faLifeRing, faSignOutAlt, faEllipsisV, faArrowLeft } from '@fortawesome/free-solid-svg-icons';
import 'tailwindcss/tailwind.css';

const SidebarContext = React.createContext();

export default function Dashboard() { 
  return (
    <div className="flex">
      <Sidebar>
        <SidebarItem icon={faColumns} text="Soal" alert active />
        <SidebarItem icon={faChartBar} text="Lembaga" />
        <SidebarItem icon={faUserCircle} text="Users" />
        <SidebarItem icon={faBoxes} text="Inventory" />
        <SidebarItem icon={faShoppingCart} text="Order" />
        <SidebarItem icon={faFileInvoice} text="Bills" />
        <hr className='my-3'/>
        <SidebarItem icon={faCog} text="Settings" />
        <SidebarItem icon={faLifeRing} text="Help" />
      </Sidebar>
      <InputDataForm />
    </div>
  );
}

function Sidebar({ children }) {
  const [expanded, setExpanded] = useState(true);

  return (
    <aside className="h-screen w-64">
      <nav className="h-full flex flex-col bg-blue-400 border-r shadow-sm ml-6 my-6 rounded-xl">
        <div className="p-4 pb-2 flex justify-between items-center">
          <button
            onClick={() => setExpanded((curr) => !curr)}
            className="p-1.5 rounded-lg"
          >
            <FontAwesomeIcon icon={faArrowLeft} />
          </button>
        </div>

        <SidebarContext.Provider value={{ expanded }}>
          <ul className="flex-1 px-3">{children}</ul>
        </SidebarContext.Provider>

        <div className="border-t flex p-3">
          <FontAwesomeIcon icon={faSignOutAlt} />
          <div
            className={`flex justify-between items-center overflow-hidden transition-all ${expanded ? "w-52 ml-3" : "w-0"
              }`}
          >
            <div className="leading-4">
              <h4 className="font-semibold">Logout</h4>
            </div>
            <FontAwesomeIcon icon={faEllipsisV} size="lg" />
          </div>
        </div>
      </nav>
    </aside>
  );
}

function SidebarItem({ icon, text, active, alert }) {
  const { expanded } = React.useContext(SidebarContext);

  return (
    <li
      className={`relative flex items-center py-2 px-3 my-1 font-medium rounded-md cursor-pointer transition-colors group ${
        active
          ? "bg-gradient-to-tr from-indigo-200 to-indigo-100 text-black"
          : "hover:bg-indigo-50 text-gray-600"
      }`}
    >
      <FontAwesomeIcon icon={icon} />
      <span
        className={`overflow-hidden transition-all ${
          expanded ? "w-52 ml-3" : "w-0"
        }`}
      >
        {text}
      </span>
      {alert && (
        <div className={`absolute right-2 w-2 h-2 rounded bg-red-700`} />
      )}
      {!expanded && (
        <div
          className="absolute left-full rounded-md px-2 py-1 ml-6 bg-indigo-100 text-black text-sm invisible opacity-20 -translate-x-3 transition-all group-hover:visible group-hover:opacity-100 group-hover:translate-x-0"
        >
          {text}
        </div>
      )}
    </li>
  );
}

function InputDataForm() {
  return (
    <div className="bg-white flex-grow flex justify-center items-center">
      <div className="bg-white rounded-lg shadow-2xl p-12 w-[70%] max-w-[800px]">
        <h2 className="text-2xl mb-8 font-bold text-left">Input Data Diri</h2>
        <form className="space-y-6">
          <div className="input-group flex flex-col mb-5 w-full">
            <label className="text-sm mb-2">Nama Peserta</label>
            <input
              type="text"
              placeholder="Nama Peserta"
              className="border border-gray-300 rounded-full py-2 px-4 text-base shadow-md w-full"
            />
          </div>
          <div className="input-group flex flex-col mb-5 w-full">
            <label className="text-sm mb-2">Deskripsi</label>
            <input
              type="text"
              placeholder="Deskripsi"
              className="border border-gray-300 rounded-full py-2 px-4 text-base shadow-md w-full"
            />
          </div>
          <div className="input-group flex flex-col mb-5 w-full">
            <label className="text-sm mb-2">Nama Instansi</label>
            <input
              type="text"
              placeholder="Nama Instansi"
              className="border border-gray-300 rounded-full py-2 px-4 text-base shadow-md w-full"
            />
          </div>
          <button
            type="submit"
            className="submit-btn bg-black text-white py-2 px-8 rounded-full cursor-pointer text-base mt-8 self-end hover:bg-gray-800"
          >
            Selesai
          </button>
        </form>
      </div>
    </div>
  );
}
